import './index.css'

const Modal = ({open, setOpen, title, text}) => {
    
    return ( 
      <div className={open ? "modal active" : "modal"} onClick={() => setOpen(true)} >
        <div className="modal__content" onClick={e => e.stopPropagation()} >
          <div>{title}</div>
        </div>
      </div>
    );
  }
  
  export default Modal;
